from typing import List,  Optional
from collections import defaultdict
class Solution:
    def nearestExit(self, maze: List[List[str]], entrance: List[int]) -> int:
        queue = [(entrance[0], entrance[1], 0)]
        maxRow, maxCol = len(maze), len(maze[0])
        visited = [entrance]
        shortest = -1
        while queue:
            posRow, posCol, distance = queue.pop(0)
            # print(posRow, posCol, distance)
            if [posRow, posCol] != entrance:
                if posRow == 0 or posRow == maxRow - 1 or posCol == 0 or posCol == maxCol - 1:
                    if shortest == -1:
                        shortest = distance
                    else:
                        shortest = min(distance, shortest)
            for dx, dy in [(1, 0), (-1, 0), (0, 1),  (0, -1)]:
                newRow = posRow + dx
                newCol = posCol + dy
                # print(posRow, posCol)
                if newRow >= 0 and newRow < maxRow and newCol >= 0 and newCol < maxCol:
                    if maze[newRow][newCol] == ".":
                        # visited.append([newRow, newCol])
                        queue.append((newRow, newCol, distance + 1))
                        maze[newRow][newCol] = "+"
        return shortest
